import './App.css';

function App() {
  return (
    <div>
      <form onSubmit={mostrar}>
        <p>Ingrese primer valor:
          <input type="text" name="valor1" />
        </p>
        <p>Ingrese segundo valor:
          <input type="number" name="valor2" />
        </p>
        <p>
          <input type="submit" value="Sumar" />
        </p>
      </form>
    </div>
  );
  function mostrar(e)
  {
    e.preventDefault();
  }

}

export default App;
